  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0104372 includes physical
  and underway data collected aboard the THOMAS G. THOMPSON during cruise TN279 in
  the Coastal Waters of SE Alaska and North Pacific Ocean from 2012-03-11 to 2012-04-30.
  These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
  These data were collected by UNIVERSITY OF WASHINGTON as part of Transit. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program. The ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
